import { Link } from 'react-router-dom';



export default function Footer () {


    return (
        <>
            <footer className='footer'>
                <a href='#home'>To the top </a>
                <div className='footer-icons'>
                    <a href='https://www.linkedin.com/in/erik-torvbrÃ¥ten-4252301b8/'>
